import React from "react";
import {
  interaction,
  layer,
  custom,
  control, //name spaces
  Interactions,
  Overlays,
  Controls, //group
  Map,
  Layers,
  Overlay,
  Util //objects
} from "react-openlayers";


export const MapPage = () => {

 
  return (
    <Map view={{center: [0, 0], zoom: 1}} >
      <Layers>
        <layer.Tile />
      </Layers>
      <Controls attribution={false} zoom={true}></Controls>
    </Map>
    
  );
};
